import React from 'react'
import './Footer.css';

const ForSellers = () => {

    const [searchQuery, setSearchQuery] = useState('');
  const [selectedSeller, setSelectedSeller] = useState(null);

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleViewProfile = (seller) => {
    setSelectedSeller(seller); // Define o vendedor a ser exibido na visualização de perfil
  };

  const handleCloseProfile = () => {
    setSelectedSeller(null); // Fecha a visualização do perfil ao redefinir o estado
  };

  const sellers = [
    {
      id: 1,
      name: 'Vendedor 1',
      image: image1,
      revenue: '$500K',
      growthRate: '20%',
      profitMargins: '30%',
      type: 'SaaS',
      description: 'Vendedor 1 é uma empresa SaaS com crescimento consistente.',
    },
    // Additional sellers here...
  ];
  return (
    <div>
      <>
      <div className="background-section">
        <div className="background-content">
          <h1>Negócios Online à Venda</h1>
          <p>Negócios online lucrativos de vendedores confiáveis</p>
          <button className="cta-button">Cadastre-se para Acesso Completo</button>
        </div>
      </div>

      {/* Nova Seção */}
      <div className="sell-business-section">
        <div className="sell-business-content">
          <h1>Venda Seu Negócio Online</h1>
          <p>Removemos a fricção de comprar e vender negócios online.</p>
          <div className="sell-business-icons">
            <div className="yellow-box">
              <i className="icon-tool"></i>
              <h3>Ferramenta de Avaliação</h3>
              <p>Veja quanto vale seu negócio online hoje com esta ferramenta.</p>
              <button className="yellow-button">Experimente Agora</button>
            </div>
            <div className="blue-box">
              <i className="icon-list"></i>
              <h3>Liste Seu Negócio Online</h3>
              <p>Liste seu negócio online e alcance milhares de compradores qualificados.</p>
              <button className="blue-button">Comece Agora</button>
            </div>
          </div>
        </div>
      </div>

      {/* Seção Principal */}
      <div className="sellers-listing-fullpage">
        <h2>Explore os Vendedores</h2>

        {/* Barra de Pesquisa */}
        <div className="search-bar-container">
          <input
            type="text"
            placeholder="Pesquisar Vendedores..."
            value={searchQuery}
            onChange={handleSearchChange}
            className="search-input"
          />
        </div>

        <div className="content-container">
          {/* Seção de Grade de Vendedores */}
          <div className="sellers-grid-section">
            <div className="sellers-grid">
              {sellers.map((seller) => (
                <div key={seller.id} className="seller-card">
                  <img src={seller.image} alt={seller.name} className="seller-image" />
                  <h3>{seller.name}</h3>
                  <div className="seller-stats">
                    <p>Receita Anual: {seller.revenue}</p>
                    <p>Taxa de Crescimento: {seller.growthRate}</p>
                    <p>Margem de Lucro: {seller.profitMargins}</p>
                  </div>
                  <button
                    className="view-profile-button"
                    onClick={() => handleViewProfile(seller)}
                  >
                    Ver Perfil
                  </button>
                </div>
              ))}
            </div>
          </div>
        </div>

        {/* Visualização de Perfil */}
        {selectedSeller && (
          <SellerProfile seller={selectedSeller} onClose={handleCloseProfile} />
        )}
      </div>
      
      
      
      </>
    </div>
  )
}

export default ForSellers
